  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents seabird species
  richness, or number of species, predictions from spatial models developed for the
  New York offshore spatial planning area. This raster was derived from multiple individual
  species season models. The model also includes spatially-explicit uncertainty estimates
  represented in another raster dataset. Raster values represent the annual predicted
  number of seabird species.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
